import React from 'react'
import Axios from 'axios'

function Test() {

  

  const getTest = () => {
    Axios.get("http://45.77.232.166:8080/get-pcos").then((response)=> {
      console.log(response);
      
    })
  }

  return(
    <div>
      <button onClick={getTest}>Get Info</button>
    </div>
  );
}

export default Test;
